import React from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import '../App.css'

function NavBar() {
  return (
    <Navbar className="navbar-fixed-top bg-transparent" expand="lg"
      style={{ position: 'fixed', width: '100%', zIndex: '1000' }}>
      <Container>
        <Navbar.Brand as={Link} to="/">
          <img 
              scr="/images/logo.png"
              alt="logo"
              style={{ height: '40px', width: 'auto' }}
          />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="navbar-nav" />
        <Navbar.Collapse id="navbar-nav">
          <Nav className="ms-auto">
            <Nav.Link as={Link} to="/">Home</Nav.Link>
            <Nav.Link as={Link} to="/tentangKami">Tentang Kami</Nav.Link>
            <Nav.Link as={Link} to="/diagnosis">Diagnosis</Nav.Link>
            <Nav.Link as={Link} to="/history">Riwayat</Nav.Link>
            <Nav.Link as={Link} to="/auth">Login</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavBar;
